import React from 'react';
import { withRouter, Link } from 'react-router-dom';
import './styles.scss';

const ReadButton = (props) => {
  return (
    <div className='button'>
      <Link
        to={{
          pathname: `/job-guide/${props.selectedArticleId}`,
        }}
      >
        Read More
      </Link>
    </div>
  );
};

export default ReadButton;
